import React from 'react';
import Tenzies from './components/Tenzies.js'
import Die from './components/Die.js'
import {nanoid} from 'nanoid'
import Confetti from 'react-confetti'
import Stopwatch from './components/Stopwatch.js'


function App() {

  const [viewSetting, setViewSettings] = React.useState(false)

  function handleClick(){
    setViewSettings(true)
  }

  function Settings(){
    return(
      <div className="settings">
        <h2>Difficulty</h2>
        <div>
          <button>Easy</button>
          <button>Medium</button>
          <button>Hard</button>
        </div>
      </div>
    )
  }

  return(
    <div className="app">
      <div className="settings-button" onClick={handleClick}>{viewSettings?"Back":"Settings"}</div>
      {viewSetting?<Settings />:<Tenzies />}
    </div>
  )
}

export default App;
